import React from 'react'
import './NavBarMobile.scss'

export default function NavBarMobile({checked,list}) {
	return (
		<div style={{opacity:checked?'1':'0'},{transform:checked?'scale(1)':'scale(0)'}} className="NavBarMobile">
			{list}
		</div>
	)
}
